A microporous crystalline material of a zeolitic nature that, in a calcinated and anhydrous state, has a chemical composition represented by the formula: 

x (M _{ 1/n } XO _{ 2 } ): y YO _{ 2 } :z GeO _{ 2 } :(1 z )TO _{ 2 } 

wherein x has a value below 0.2, y has a value below 0.1, z has a value below 1, with at least one of x, z and y being above zero; M is H or at least an inorganic cation with a n charge; X is at least one chemical element with a 3 oxidation status; Y is at least one chemical element with a oxidation status; and T is at least one chemical element with a 4 oxidation status (Si, Ti, Sn, V), this material having a specific X-ray diffraction pattern. A method for preparation of the material and its use as a catalyst in organic compound separation and transformation processes is also described.

Passive security system and personal equipment on vessels for man over board situations. The personal equipment, prepared for being worn by a crewmember of the vessel, comprises: 
- a first module (2) integrated into a belt (4); 
- a life jacket (5) folded inside of the first module (2) and attached thereto by at least one strap (6); 
- a second module (8) placed in the interior of the first module (2), connected to the life jacket (5) and configured to inflate the life jacket (5) when it detects a man over board situation, the first module (2) having on its rear part one flap (3) configured to be opened by the life jacket (5) inflating action, allowing the passage thereof to the exterior of the first module (2). It is used as a passive security element for "man over board" situations, to allow an immediate detection of said situation and a fast rescue.
